import { CarViewRow } from "./CarViewRow.js";
import { CarEditRow } from "./CarEditRow";

export const CarTable = props => {
    return (
        <table>
            <thead>
                <tr>
                    <th>ID</th>
                    <th>MAKE</th>
                    <th>MODEL</th>
                    <th>YEAR</th>
                    <th>COLOR</th>
                    <th>PRICE</th>
                    <th>Action</th>
                </tr>
            </thead>
            <tbody>
                { props.cars.map(car => car.isEditable === false ?
                     <CarViewRow key={car.id} car={car} deleteCar={props.onDeleteCar} editCar={props.onEditCar} /> : 
                     <CarEditRow key={car.id} car={car} cancel={props.onClickCancel}/>) }
            </tbody>
        </table>
    );
};

CarTable.defaultProps = {
    cars: [],
}
